import React, { Component } from "react";

class Suit extends Component {
  render(props) {
    console.log(props);
    // const startCount = props.startCount;
    // const IdealCount = props.IdealCount;
    // const difference = props.IdealCount - props.startCount;
    return (
      <div>
        <h1>Suit</h1>
        <h2>StartCount : {this.props.startCount}</h2>
        <h2>IdeaCount : {this.props.IdealCount}</h2>
        <h2>Difference : {this.props.difference}</h2>
      </div>
    );
  }
}

export default Suit;
